import React, { FC } from 'react';

interface Props {
    menu?: any;
}

const index: FC<Props> = ({ menu }) => {
    return (
        <div>
            <div className="h-screen -w-72 bg-white z-50 absolute"></div>
        </div>
    );
};

export default index;
